-- ----------------------------
-- Table structure for zoneData
-- ----------------------------

CREATE TABLE IF NOT EXISTS `zonedata` (
  `zone` varchar(5) NOT NULL,
  `area` varchar(160) DEFAULT NULL,
  `state` varchar(20) DEFAULT NULL,
  `bearing` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`zone`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of zoneData
-- ----------------------------

-- ----------------------------
-- Table structure for prayerTime
-- ----------------------------

CREATE TABLE IF NOT EXISTS `prayertime` (
  `zone` varchar(5) NOT NULL,
  `hijri` varchar(10) DEFAULT NULL,
  `date` date NOT NULL,
  `day` varchar(10) DEFAULT NULL,
  `imsak` varchar(10) DEFAULT NULL,
  `fajr` varchar(10) DEFAULT NULL,
  `syuruk` varchar(10) DEFAULT NULL,
  `dhuhr` varchar(10) DEFAULT NULL,
  `asr` varchar(10) DEFAULT NULL,
  `maghrib` varchar(10) DEFAULT NULL,
  `isha` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`zone`,`date`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;
